import Col from 'react-bootstrap/Col';
import Row from 'react-bootstrap/Row';
import { Link } from "react-router-dom";
import { useState } from 'react';

import pastEvents from "../../data/pastEvents.json";

function PastEvents() {

    const [strEventDetails, setStrEventDetails] = useState("");

    const eventList = pastEvents.map((event) =>(

        <div key={event.id}>

            {
                setStrEventDetails(JSON.stringify(event.details))
            }

            <Col>
                <Link
                to={{
                    pathname: `/events/${event.urlName}`
                }}
                state={{
                    id: `${event.id}`,
                    urlName: `${event.urlName}`,
                    name: `${event.name}`,
                    location: `${event.location}`,
                    date: `${event.date}`,
                    image: `${event.image}`,
                    details: `${strEventDetails}`,
                }}
                >
                    <div className="card">
                        <img src={event.image} className="card-img" alt={event.name}/>
                        <div className="card-body">
                            <span className="copyright">{event.date}</span>
                            <span className="card-title medium">{event.name}</span>
                        </div>
                    </div>
                </Link>
            </Col>
        </div>

    ));

    return(
        <>
            <div className="row past-events">
                <div className="col">
                    <h4>Past events</h4>
                    <Row xs={1} md={4} className="g-4">
                        {eventList}
                    </Row>
                </div>
            </div>
        </>
    );
}

export default PastEvents;
